// App.js
import { useState } from "react";

function App() {
  const endpoint = "http://localhost:8000/things";

  const options = {
    method: "GET",
    headers: { "Content-Type": "application/json" },
  };

  fetch(endpoint, options);

  return (
    <main>
      <h1>Basic FARM Stack</h1>
    </main>
  );
}

export default App;
